import React from "react";
import HeaderMenu from "../components/HeaderMenu";
import {FormControl, Grid, MenuItem, OutlinedInput, Select} from "@material-ui/core";
import {connect} from "react-redux";
import {get} from "../actions/Status";

class AddNewTask extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			name: "",
		}

		this.props.get();
	}

	render() {

		return (
			<Grid
				xs={12}
				sm={12}
				lg={12}
				md={12}
				item
				container
			>
				<HeaderMenu history={this.props.history} />
				<FormControl fullWidth>
					<OutlinedInput
						placeholder={"Task name"}
						id={"name"}
						name={"name"}
						value={""}
						fullWidth
					/>
				</FormControl>
				<FormControl fullWidth>
					<Select
						labelId="demo-simple-select-helper-label"
						id="demo-simple-select-helper"
						label="Age"
					>
						<MenuItem value="">
							<em>None</em>
						</MenuItem>
						<MenuItem value={10}>Ten</MenuItem>
						<MenuItem value={20}>Twenty</MenuItem>
						<MenuItem value={30}>Thirty</MenuItem>
					</Select>
				</FormControl>
			</Grid>
		);
	}
}

const mapStateToProps = state => state.StatusStore;

const mapDispatchToProps = () => dispatch => ({
	get: () => dispatch(get()),
});

export default connect(mapStateToProps, mapDispatchToProps)(AddNewTask);
